import {
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  AreaChart,
  Area,
  ResponsiveContainer,
} from 'recharts';

const WeatherChart = ({ forecastOfDay }) => (
  <ResponsiveContainer width="100%" height={200}>
    <AreaChart
      width={1000}
      height={200}
      data={forecastOfDay}
      syncId="anyId"
      margin={{
        top: 10,
        right: 30,
        left: 0,
        bottom: 0,
      }}
    >
    <CartesianGrid strokeDasharray="3 3" />
    <XAxis dataKey="time" />
    <YAxis dataKey='' />
    <Tooltip />
    <Area type="monotone" dataKey="temp" stroke="#82ca9d" fill="#82ca9d" />
    </AreaChart>
  </ResponsiveContainer>
);

export default WeatherChart;
